        "anchor": "string"
    },
    "_viewModelId": "AwContextControl",
    "_uniqueViewModelId": "AwContextControl"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awContextControlRenderFunction, undefined, ctxImportObj );

